import React from 'react';
import './home.css';
import logo from './logo.png';

function home() {
  return (
      <div className="home">
              <div className="home__bg">
                <div className="header d__flex align__items__center pxy__30">
                  <div className="logo">
                    <img src={logo} alt=" "/>

                  </div>
                </div>
              </div>
      </div>
  )
}

export default home
